import React from 'react'
import './food.css'
 const Food = () => {
    return (
        <div className='food'>
            <div>
            <img src="./asset/group.png" alt="pic" />
            <h1>FOOD HUB</h1>
            </div>
        </div>
    )
}
export default Food
